import React from 'react';

export default class Log extends React.Component {
  state = {
    ps: 's',
    pz: 'z',
  };

  // Ren = (eve) => {
  //   eve.preventDefault();
  //   this.props.Ren(this.state.pz);
  // };
  // changeTitle = (ev) => {
  //   this.setState({ ps: ev.target.value }, { pz: ev.target.value });
  // };
  Ren = (text, ps) => {
    const newList = {
      email: text,
      password: ps,
      id: this.newId++,
    };
    this.setState(({ login }) => {
      const myLastTodo = [...login, newList];
      return { login: myLastTodo };
    });
  };

  render() {
    return (
      <form onSubmit={this.Ren}>
        <input type='email' placeholder='Email' onChange={this.changeTitle} />
        <input
          type='password'
          placeholder='Password'
          minLength='6'
          onChange={this.changeTitle}
        />
        <button>
          <b> Login in</b>
        </button>
      </form>
    );
  }
}
